    <main >
      <div class="main-container">
      <div class="content">
        <h1>To Do List</h1>
      </div>
      <div class="content">
        <input type="text" placeholder="new item" id='text'></input>
      </div>
      <div class="content" id='button'>
        <button >+</button>
      </div>

      <p>{text}</p>
        <button onClick={() => setText("Hello, World!")}>Click Me</button>
      </div>


    </main>

  );
}

export default App
